import React from 'react';
import './App.css';
import {BrowserRouter, Switch, Route} from 'react-router-dom'
import Home from './Screens/home'
import Weddingparty from './Screens/weddingpartyscr'


//Add Blog

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path='/'>
          <Home />
        </Route>
        <Route path='/weddingparty'>
          <Weddingparty />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
